import React,{Component} from 'react';
import './Myheaderstyle.css';

class Myheader extends Component {

    constructor(props) {
        super(props);
    }
    
    render() {

        return (
            <div className="Myheader">
                    <div className="headder_element">现有确诊</div>
                    <div className="headder_element">累计确诊</div>
                    <div className="headder_element">累计治愈</div>
                    <div className="headder_element">累计死亡</div>
            </div>
        )
    }
}

export default Myheader;
